package com.huateng.ebank.business.dataquery.bean;

import java.io.Serializable;
import java.util.Date;

public class ExecuteStateQueryBean implements Serializable {
	private String brNo;//机构号
	private String brName;//机构名称
	private String workDate;//工作日期
	private String operType;//操作类型
	private String busiType;//业务类型
	private Date startTime;//开始时间
	private Date endTime;//结束时间
	
	public ExecuteStateQueryBean() {
		// TODO Auto-generated constructor stub
	}
	public ExecuteStateQueryBean(String brNo, String brName, String workDate,
			String operType, String busiType, Date startTime, Date endTime) {
		super();
		this.brNo = brNo;
		this.brName = brName;
		this.workDate = workDate;
		this.operType = operType;
		this.busiType = busiType;
		this.startTime = startTime;
		this.endTime = endTime;
	}
	public String getBrNo() {
		return brNo;
	}
	public void setBrNo(String brNo) {
		this.brNo = brNo;
	}
	public String getBrName() {
		return brName;
	}
	public void setBrName(String brName) {
		this.brName = brName;
	}
	public String getWorkDate() {
		return workDate;
	}
	public void setWorkDate(String workDate) {
		this.workDate = workDate;
	}
	public String getOperType() {
		return operType;
	}
	public void setOperType(String operType) {
		this.operType = operType;
	}
	public String getBusiType() {
		return busiType;
	}
	public void setBusiType(String busiType) {
		this.busiType = busiType;
	}
	public Date getStartTime() {
		return startTime;
	}
	public void setStartTime(Date startTime) {
		this.startTime = startTime;
	}
	public Date getEndTime() {
		return endTime;
	}
	public void setEndTime(Date endTime) {
		this.endTime = endTime;
	}

	
	
}
